import React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import '../Login/Login.scss';

function Login() {

  return (
    <>
     <div className="Login-container">
            <h1 className="Login-title">Fundo</h1>
            <h2 className="Login-subtitle">Sign in</h2>
            <p className="Login-description">Use your Fundoo Account</p>
            <form className="Login-form">
                {/* <input 
                    type="text" 
                    placeholder="Email or phone*" 
                    className="input" 
                    required 
                /> */}
                <TextField id="outlined-basic" label="Email or phone*" variant="outlined"/>
                <br/>

                {/* <input 
                    type="password" 
                    placeholder="Password*" 
                    className="input" 
                    required 
                /> */}
                 <TextField id="outlined-basic" label="Password*" variant="outlined"/>
                 <br/>

                {/* <button type="submit" className="button">Login</button> */}
                <Button variant="contained">Login</Button>
                <div className="Loginmlinks">
                {/* eslint-disable-next-line jsx-a11y/anchor-is-valid */}
                    <a href="#" className="link">Forgot password</a>
                    <span className="link"> | </span>
                {/* eslint-disable-next-line jsx-a11y/anchor-is-valid */}
                    <a href="#" className="link">Create account</a>
                </div>
            </form>
            <div className="footer">
                <select className="select">
                    <option>English (United States)</option>
                    {/* Add more languages as needed */}
                </select>
                <span className="link">Help</span>
                <span className="link">Privacy</span>
                <span className="link">Terms</span>
            </div>
        </div>
    </>
  );
}

export default Login;
